import React from "react";
import Item from './Item';
import './Links.css'
function Links(){
    return(
        <div className="linkhead">
         <div className="content">
          <Item title="HOME" link="homepage" />
          <Item title="KNOW ME"/>
          <Item title="COMPETITIVE STATS"/>
          <Item title="PROJECTS"/>
          <Item title="GET IN TOUCH!"/>
          </div>
          </div>
    );
}

export default Links;
